import React from "react";

const HomeWork = ({ name, category, id, description, url, cover }) => {
  return (
    <>
      <div className="flex">
        <h3>{name}</h3>
        <p>{category}</p>
        <p>{id}</p>
      </div>
    </>
  );
};

export default HomeWork;
